        public static async Task Main(string[] args)
        {
            var persons = JsonConvert.DeserializeObject<List<Speaker>>(jsonRiksdag);

            var faceClient = new FaceClient(new ApiKeyServiceClientCredentials(subscriptionKey))
            {
                Endpoint = faceEndpoint
            };

            await DetectFaces(persons, faceClient);

            //await TrainFaces(persons, faceClient);

            //await IdentifyFace(faceClient);

            Console.ReadLine();
        }

        #region Detect demo

        private static async Task DetectFaces(List<Speaker> speakers, FaceClient faceClient)
        {
            var speakerRequests = new List<Task<SpeakerWithFace>>();
            foreach (var speaker in speakers)
            {
                Console.WriteLine($"Detecting {speaker.name}..");
                var task = DetectRemoteAsync(faceClient, speaker);
                _ = task.ContinueWith(x => Console.WriteLine($"Detected {speaker.name}.."));
                speakerRequests.Add(task);
            }

            await Task.WhenAll(speakerRequests);

            var speakerWithFace = speakerRequests.Select(x => x.Result)
                                                 .OrderBy(x => x.Face?.FaceAttributes.Age);

            foreach (var speaker in speakerWithFace)
            {
                Console.WriteLine(GetPersonText(speaker, speaker.Face));
            }

            using (var writer = File.CreateText("speakers.json"))
            {
                writer.Write(JsonConvert.SerializeObject(speakerWithFace));
            }
        }

        private static string GetPersonText(Speaker speaker, DetectedFace face)
        {
            var text = $"{speaker.name,-35}";

            if (face != null)
            {
                text += $" | Age: {face.FaceAttributes.Age,-3}" +
                $" | Gender: {face.FaceAttributes.Gender, -7}" +
                $" | Smile: {face.FaceAttributes.Smile, -10}" +
                $" | Fear: {face.FaceAttributes.Emotion.Fear,-10}";
            }
            else
            {
                text += " | No face found!";
            }

            return text;
        }

        private static async Task<SpeakerWithFace> DetectRemoteAsync(FaceClient faceClient, Speaker speaker)
        {
            var faceList = await faceClient.Face.DetectWithUrlAsync(speaker.image, true, false, faceAttributes);
            return new SpeakerWithFace {
                name = speaker.name,
                image = speaker.image,
                Face = faceList.FirstOrDefault()
            };
        }

        #endregion

        #region Identify demo

        private static async Task IdentifyFace(FaceClient faceClient)
        {
            while (true)
            {
                Console.WriteLine($"Identify speaker in URL:");
                var url = Console.ReadLine();

                await IdentifyFace(url, faceClient);

                Console.WriteLine("");
            }
        }

        private static async Task TrainFaces(List<Speaker> speakers, FaceClient faceClient)
        {
            try
            {
                await faceClient.PersonGroup.DeleteAsync(personGroupId);
            }
            catch (Exception)
            {
            }

            await faceClient.PersonGroup.CreateAsync(personGroupId, "Speakers");

            foreach (var speaker in speakers)
            {
                Console.WriteLine($"Adding {speaker.name}...");
                var person = await faceClient.PersonGroupPerson.CreateAsync(
                    personGroupId,
                    speaker.name
                );

                try
                {
                    await faceClient.PersonGroupPerson.AddFaceFromUrlAsync(personGroupId, person.PersonId, speaker.image);
                }
                catch (Exception)
                {
                }
            }

            Console.WriteLine();
            Console.WriteLine($"Training...");
            await faceClient.PersonGroup.TrainAsync(personGroupId);
            Console.WriteLine($"Done!");
            Console.WriteLine();
        }

        private static async Task IdentifyFace(string url, FaceClient faceClient)
        {
            var faces = await faceClient.Face.DetectWithUrlAsync(url);
            var faceIds = faces.Where(face => face.FaceId.HasValue).Select(face => face.FaceId.Value).ToArray();

            var results = await faceClient.Face.IdentifyAsync(faceIds, personGroupId);
            foreach (var identifyResult in results)
            {
                if (!identifyResult.Candidates.Any())
                {
                    Console.WriteLine("No one identified");
                }
                else
                {
                    // Get top 1 among all candidates returned
                    var candidateId = identifyResult.Candidates[0].PersonId;
                    var person = await faceClient.PersonGroupPerson.GetAsync(personGroupId, candidateId);
                    Console.WriteLine("Identified as {0}!", person.Name);
                }
            }
        }

        #endregion
    }

    public class Speaker
    {
        public string name { get; set; }
        public string image { get; set; }
    }

    public class SpeakerWithFace : Speaker
    {
        public DetectedFace Face { get; set; }
    }


